import "../../style/App.css";
import Header from "../Header/Header";
import Main from "../Main/Main";
import Footer from "../Footer/Footer";
import data from "../../words.json";

function App() {
  console.log(data.words);
  return (
    <div className="App">
      <Header></Header>
      <Main arrWords={data.words}></Main>
      <Footer></Footer>
    </div>
  );
}

export default App;

function calc(a, b) {
  const res = a + b;
  return res;
}

